import React from "react";
import "./home.css";
import Zoom from "react-reveal/Zoom";

function Home() {
  const _onMouseMove = () => {
    const width = this.ref.heroText.clientWidth;
    const height = this.ref.heroText.clientHeight;
    console.log(width, height);
  };
  return (
    <div className="home">
      <div className="heroCenterContainer">
        <div className="heroContent">
          <Zoom>
            <div
              className="heroText white-text"
              onMouseMove={_onMouseMove}
              ref="heroText"
            >
              Sophia Orlando
            </div>
          </Zoom>
        </div>
      </div>
    </div>
  );
}

export default Home;
